import React from 'react';

import VegasBg from './assets/images/vegas.png';
import MovioLogo from './assets/images/movio.svg';

import TimerComp from './components/TimerComp';

function App() {
  return (
    <div className="h-screen bg-black">
      <div className="h-full">
          <div
            className="h-full"
            >
            <div className="py-8 h-full flex flex-col justify-between">
              <img className="flex flex-col items-center space-y-12 m-auto w-1/5 mt-12" src={MovioLogo} />
              <div className="flex flex-col items-center space-y-12 absolute top-1/3 w-full">
                <span className="text-white font-bold text-lg tracking-3xl text-center">
                  CINEMACON
                </span>
                <img className="flex flex-col items-center space-y-12 m-auto w-full absolute bottom" src={VegasBg} />

                <div>
                  <TimerComp />
                </div>
              </div>
            </div>

          </div>
        </div>
    </div>
  );
}

export default App;
